class Solution {
public:
    int minDominoRotations(vector<int>& A, vector<int>& B) {
        int n = B.size();
        vector<int> sol;


        int a = A[0], count_a = 0;
        for (int i = 0 ; i < n ; ++i) {
            if (A[i] == a) {
                continue;
            } else if (B[i] != a) {
                count_a = -1;
                break;
            } else if (B[i] == a){
                count_a ++;
            }
        }
        if(count_a != -1)
            sol.push_back(count_a);

        
        int b = B[0], count_b = 0;
        for (int i = 0 ; i < n ; ++i) {
            if (B[i] == b) {
                continue;
            } else if (A[i] != b) {
                count_b = -1;
                break;
            } else if (A[i] == b){
                count_b ++;
            }
        }
        if(count_b != -1)
            sol.push_back(count_b);

        int c = B[0], count_c = 0;
        for (int i = 0 ; i < n ; ++i) {
            if (A[i] == c) {
                continue;
            } else if (B[i] != c) {
                count_c = -1;
                break;
            } else if (B[i] == c){
                count_c ++;
            }
        }
        if(count_c != -1)
            sol.push_back(count_c);

        int d = A[0], count_d = 0;
        for (int i = 0 ; i < n ; ++i) {
            if (B[i] == d) {
                continue;
            } else if (A[i] != d) {
                count_d = -1;
                break;
            } else if (A[i] == d){
                count_d ++;
            }
        }
        if(count_d != -1)
            sol.push_back(count_d);
        
        sort(sol.begin(), sol.end());
        return sol.size() > 0 ? sol[0] : -1;


    }
};


